import axios from "axios";
import { postRequest } from "../http/utils";

export const postLogin = (email: string, password: string) => {
	return postRequest(`/api/registration`, { email, password, post: "Admin" }).then((res) => res.data)
}
export const postLoginTest = async (email: string, password: string) => {
	return axios.post('http://localhost:8000"/api/registration', { email, password, role: 'ADMIN' }).then((res)=>res.data)
}
